import React, { useRef } from 'react';

const Login = () => {
  const loginForm = useRef();

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
  };

  return (
    <>
      <div className="loginHeader">
        <h1 className="loginTitle">Login with your Sign-In Information</h1>
        <h3 className="loginTitleDescript">If you need help with signing in, contact the wedding planner for details</h3>
      </div>

      <div className="loginBody">
        <form ref={loginForm} onSubmit={handleSubmit} method="post" id="loginForm">
          {/* Add your form input fields here */}
          <input type="text" name="username" placeholder="Username" />
          <input type="password" name="password" placeholder="Password" />

          {/* Custom submit button */}
          <button type="submit">Custom Sg gubmit</button>
        </form>
      </div>
    </>
  );
};

export default Login;
